For the first time the full story is told of one of literature's most
misunderstood and influential Gay writers - W. Somerset Maugham, author
of Of Human Bondage, The Razor's Edge, The Painted Veil, Rain &amp; numerous
other classic stories, plays and novels. Somerset Maugham broke all the
rules of literature yet became the most successful writer of his age and
the world's first 'millionaire author'. Today his books continue to be
read by millions and Somerset Maugham is admired by countless best-selling
authors. Includes interviews with Armistead Maupin, Alexander McCall Smith,
Pico Iyer, Alan Furst, Selina Hastings, Ronald Harwood, Nicky Haslam,
